  const [targetOrder, setTargetOrder] = useState([0])

  return (
    <div>

      <p>Hello Next.js</p>
      <NewList lists={lists} setLists={setLists}/>
      <div className='lists-container'>
        {lists.map((item, index) => <List order={index} key={item.key} title={item.title}/>)}
      </div>
      <div className='targets-container'>
        {lists.map((item, index) => <Target order={index}/>)}
      </div>

      <style jsx>{`

        .targets-container {
          position: absolute;
          display: flex;
        }
        .lists-container {
          display: flex;
        }
      `}</style>
    </div>
  )
}
